import React, { Fragment } from "react";
import {
  Row,
  Col,
  Input,
  Divider,
  Button,
  Typography,
  Layout,
  InputNumber,
} from "antd";
const Cabinet = ({
  first_name,
  last_name,
  gender,
  age,
  address,
  email,
  work_position,
  phone_number,
  password,
  handleChange,
  handleAgeChange,
  handlePhoneChange,
  handleUpdate,
}) => {
  return (
    <Fragment>
      <Layout.Content style={{ margin: "2em 16px" }}>
        <div
          style={{ background: "#fff", padding: 24, minHeight: 280 }}
          className="border border-dark rounded"
        >
          <Typography.Title>
            Profile
            <br />
            <Typography.Text style={{ fontSize: "15px", marginTop: "0px" }}>
              The Information Can be Edit
            </Typography.Text>
          </Typography.Title>
          <Divider />
          <Input value={first_name} name="first_name" onChange={handleChange} />
          <select
            class="form-control"
            value={gender}
            name="gender"
            onChange={handleChange}
          >
            <option value="Male">Male</option>
            <option value="Female">Female</option>
          </select>
          <Input
            value={last_name}
            name="last_name"
            onChange={handleChange}
            max={10}
          />
          <InputNumber
            className="w-100"
            value={age}
            name="age"
            onChange={handleAgeChange}
            min={0}
            max={100}
          />
          <Input value={address} name="address" onChange={handleChange} />
          <Input value={email} name="email" onChange={handleChange} />
          <select
            class="form-control"
            name="work_position"
            value={work_position}
            onChange={handleChange}
          >
            <option value="Chef">Chef</option>
            <option value="Manager">Manager</option>
            <option value="Waiter">Waiter</option>
            <option value="Cleaner">Cleaner</option>
          </select>

          <Input value={password} name="password" onChange={handleChange} />
          <InputNumber
            className="w-100"
            value={phone_number}
            name="phone_number"
            onChange={handlePhoneChange}
            min={0}
          />
          <Button onClick={handleUpdate}>Edit</Button>
        </div>
      </Layout.Content>
    </Fragment>
  );
};

export default Cabinet;
